import React, { useState } from "react";

function App() {
  const [active, setActive] = React.useState(1)

  return (
    <AppStyled bg={bg} className="App">
      <Orb />
      <MainLayout>
        <Navigation active={active}  />
      </MainLayout>
    </AppStyled>
  )
}

const AppStyled = styled.div`
  height: 100vh;
  background-image: url(${props => props.bg});
  position: relative;
`;

export default App;
